import { useState } from "react";
import axios from "axios";
import Swal from "sweetalert2";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  Grid,
} from "@mui/material";

const ContactUsDialog = ({ open, onClose }) => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    jobTitle: "",
    companyName: "",
    country: "",
    businessEmail: "",
    mobile: "",
    solution: "",
  });

  const showAlert = () => {
    Swal.fire({
      text: "Thank You For Contacting Us",
      icon: "success",
    });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name) {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/database", formData);
      setFormData({
        firstName: "",
        lastName: "",
        jobTitle: "",
        companyName: "",
        country: "",
        businessEmail: "",
        mobile: "",
        solution: "",
      });
      showAlert();
      onClose(); // Close dialog after submission
    } catch (error) {
      console.error("Error adding profile:", error);
    }
  };

  return (
    <Dialog open={open} onClose={onClose} fullWidth maxWidth="sm">
      <DialogTitle>Contact Us Form</DialogTitle>
      <DialogContent>
        <form onSubmit={handleSubmit} className="contact-form">
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                label="First Name"
                fullWidth
                required
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Last Name"
                fullWidth
                required
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Job Title"
                fullWidth
                required
                name="jobTitle"
                value={formData.jobTitle}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Company Name"
                fullWidth
                required
                name="companyName"
                value={formData.companyName}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Country"
                fullWidth
                required
                name="country"
                value={formData.country}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Mobile"
                type="number"
                fullWidth
                required
                name="mobile"
                value={formData.mobile}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="Business Email"
                type="email"
                fullWidth
                required
                name="businessEmail"
                value={formData.businessEmail}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <FormControl fullWidth required>
                <InputLabel>Solution</InputLabel>
                <Select name="solution" value={formData.solution} onChange={handleChange}>
                  <MenuItem value="Research & Analytics">Research & Analytics</MenuItem>
                  <MenuItem value="Panel Services">Panel Services</MenuItem>
                  <MenuItem value="Community Management">Community Management</MenuItem>
                </Select>
              </FormControl>
            </Grid>
          </Grid>
        </form>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="error">
          Cancel
        </Button>
        <Button type="submit" variant="contained" color="primary" onClick={handleSubmit}>
          Send The Invite
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default ContactUsDialog;
